pragma solidity >=0.5.11 <0.9.0;

import "./Owner.sol";

contract Wallet is Owner{

    struct Payment{
        uint amount;
        uint timestamp;
    }

    struct Balance{
        uint totalBalance;
        uint numPayments;
        mapping(uint => Payment) payments;
    }

    mapping(address => Balance) wallets;

    function isMe(address me) public view returns(bool){
        return msg.sender == me;
    }

    function withdraw(address payable __to, uint amount) public{
        require(isMe(__to), "You can't do this action");
        uint user_balance = wallets[msg.sender].totalBalance;
        bool can_start_withdraw = amount <= user_balance ? true : false;
        require(can_start_withdraw, "You can't withdraw more than you get");
        __to.transfer(amount);
    }

    function() external payable{
        Payment memory payment = Payment(msg.value, block.timestamp);
        wallets[msg.sender].totalBalance += msg.value;
        wallets[msg.sender].payments[wallets[msg.sender].numPayments] = payment;
        wallets[msg.sender].numPayments++;
    }

    function getBalance() public isOwner view returns(uint){
        return address(this).balance;
    }
}
